document.getElementById("pi").addEventListener("click", (evn) => {
    if ( evn.getModifierState("Shift") && evn.getModifierState("Control") ) {
      var pass = prompt("Please enter your password.");
        if (btoa(pass) == "am9zaHVh") {
             var win = window.open("", "Title", "fullscreen");
          var HTML = '';
          win.document.body.innerHTML = atob(HTML);
      } else if (btoa(pass) == "QkVSNTM0ODgzMw==") {
          var win = window.open("", "Title", "fullscreen");
            var HTML = '';
          win.document.body.innerHTML = atob(HTML);
      } else {
          alert("Access Denied.");
      };
    };
  });